import React from "react";
import Navbar from "react-bootstrap/Navbar"

function Nav() {

    return(
    <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">
            <img
                alt="Michael Scott Logo"
                src="https://vignette.wikia.nocookie.net/theoffice/images/1/17/Michael_Scott_Paper_Company_Logo.jpg/revision/latest?cb=20180718170627"
                width="30"
                height="30"
                className="d-inline-block align-top"
            />{' '}
      The Michael Scott Memory Game
    </Navbar.Brand>
    </Navbar>
    )
}

export default Nav;
